const API_URL = process.env.REACT_APP_API_URL;

const SearchService = {

    fetchSearches:() => {
        Url = `${API_URL}/searches`
        debugger
       fetch(Url)
        .then((response) => {
            debugger
        })
    }
}

export default SearchService;
